import React from 'react';
import styled from 'styled-components'

const StyledUserTag = styled.div`
  background-color: #34495e;
  border-radius: 5px;
`

const UserTag = props => {
  return(
    <StyledUserTag>
      {props.name + props.id}
    </StyledUserTag>
  )
}
